def process_data(data):
    for entry in data:
        # Generar un UUID único para cada entrada
        entry['user_id'] = str(uuid.uuid4())
        
        # Comprobar si job_title coincide con job_offer_position
        if entry['job_title'] != entry['job_offer_position']:
            entry['job_title'] = entry['job_offer_position']
    
    return data

# Procesar los datos
updated_data = process_data(data)

# Guardar el resultado en un archivo JSON
output_filename = 'updated_data.json'
with open(output_filename, 'w') as json_file:
    json.dump(updated_data, json_file, indent=4)

print(f"Datos actualizados guardados en {output_filename}")
